import React from 'react';
// import logo from './logo.svg';
// Import the BrowserRouter, Route and Link components
import { BrowserRouter, Route, Link } from 'react-router-dom'; 
// import Projects from './Projects.js'; 
import Articles from './Articles.js'; 
import About from './About.js'; 
import './App.css';
import DentalDeserts from './DentalDeserts';
import NHLAttendance from './NHLAttendance';
import CommuteForecast from './CommuteForecast';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
 
          {/*Set up the router*/}

          {/*<Route exact path="/" component={Projects} />*/}
          <Route path="/CommuteForecast" component={CommuteForecast} />
          <Route path="/DentalDeserts" component={DentalDeserts} />
          <Route path="/NHLAttendance" component={NHLAttendance} />
          <Route path="/articles" component={Articles} />
          <Route path="/about" component={About} />
          <div class="app-wrapper">
            <aside class="app-sidebar">
              <div class="app-sidebar_container">
                <div class="app-sidebar-content">
                  {/* Set up the Links*/}
                  <Link to="/" className="item">Projects</Link>
                  <Link to="/articles" className="item">Articles</Link>
                  <Link to="/about" className="item">About</Link>
                </div>
                <div class="app-sidebar-footer"></div>
              </div>
            </aside>
            <main class="app-content"> 
              <div class="homepage-wrapper">
                <div class="homepage-bg"></div>
                <div class="homepage-content">
                  <h1 class="homepage-heading">Welcome!</h1>
                  <p class="homepage-intro">This is my portfolio
                  using react! </p> 
                </div>
              </div>
            </main>
            </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
